import React, { useState } from 'react';
import Papa from 'papaparse';

function CSVUploader() {
    const [total, setTotal] = useState(0);
    const [data, setData] = useState({});

    const handleFileChange = async (event) => {
        const file = event.target.files[0];
        const formData = new FormData();
        formData.append('file', file);
    
        try {
            const response = await fetch('http://localhost:5000/upload-csv', {
                method: 'POST',
                body: formData,
            });
            const data = await response.json();
            if (response.ok) {
                setTotal(data.total);
            } else {
                console.error('Server error:', data);
            }
        } catch (error) {
            console.error('Network error:', error);
        }
    };

    const getCSVData = (file) => {
        Papa.parse(file, {
            complete: (result) => {
                console.log(result);
                setData(result.data);
            },
            header: true
        });
    };

    const calculateDefects = (data) => {
        let totalValue = 0;
        data.forEach(row => {
            // Assuming the column containing the values is named 'Amount'
            const amount = parseFloat(row.Amount);
            if (!isNaN(amount)) {
                totalValue += amount;
            }
        });
        setTotal(totalValue);
    };

    return (
        <>
            <input type="file" accept=".csv" onChange={handleFileChange} />
            <div style={{ display: "flex", justifyContent: "space-between", marginTop: "25vh", width: "60vw", marginLeft: "20vw" }}>
                <div>
                    <h2>Random Forest Regression</h2>
                    <span>Total: {total}</span>
                </div>
                <div>
                    <h2>OpenAI API Prediction</h2>
                    <span>Total: {total}</span>
                </div>
            </div>
        </>
    );
}

export default CSVUploader;
